import React, { Component } from "react";
import {Link, Switch, Route } from "react-router-dom";
import { Row, Col, Card, Button, Layout, Menu, Breadcrumb, Icon, Tree, Checkbox} from 'antd';
import LineChart from './LineChart';
const { TreeNode, DirectoryTree } = Tree;

const { SubMenu } = Menu;
const { Header, Content, Footer, Sider } = Layout;
const DataSet = require("@antv/data-set");

const options = [
  { label: 'Apple', value: 'Apple' },
];


class ChartDashboard extends React.Component {
 constructor(props) {
    super(props)
    this.state = {

    };

  }


onSelect = (keys, event) => {
    console.log('Trigger Select', keys, event);
  };

  onExpand = () => {
    console.log('Trigger Expand');
  };

onChange = (checkedValues) => {
  console.log('checked = ', checkedValues);
}




  render() {
    return (

     <div>
            <div className="page-header">
              <Row type="flex" justify="space-between">
                <Col>
                  <h1 className="page-heading"></h1>
                </Col>
                <Col>
                  <ul className="button-actions">
                    <li>
                      <div>
                        <Button type="primary" onClick={this.showModal}>
                          Create Dashboard
                        </Button>
                      </div>
                    </li>
                    <li>
                      <a href="">
                        <Button type="primary" ghost>
                          Save Dashboard
                        </Button>
                      </a>
                    </li>
                  </ul>
                </Col>
              </Row>
            </div>
          <Layout>
            <div style={{ background: '#fff', padding: 24, minHeight: 380 }}>
                <Content style={{ padding: '0 50px' }}>
                  <Layout style={{ padding: '24px 0', background: '#fff' }}>
                    <Sider width={150} style={{ background: '#fff' }}>
                      <Menu
                        mode="inline"
                        defaultSelectedKeys={['1']}
                        defaultOpenKeys={['sub1']}
                        style={{ height: '100%' }}
                      >

                                      <DirectoryTree multiple defaultExpandAll
                                            onSelect={this.onSelect} onExpand={this.onExpand}>
                                            <TreeNode title="parent 0" key="0-0" >
                                              <TreeNode title={ <span> <Icon type="filter" /> subnav 1 </span> }
                                               key="0-0-0" />
                                              <TreeNode title="leaf 0-1" key="0-0-1" isLeaf />
                                            </TreeNode>
                                      </DirectoryTree>

                        <SubMenu
                          key="sub1"
                          title={
                            <span>
                              <Icon type="filter" />
                              subnav 1
                            </span>
                          }
                        >
                          <Menu.Item key="">
                                <Checkbox onChange={this.onChange}>Status</Checkbox>
                          </Menu.Item>

                          <Menu.Item key="">
                                <Checkbox onChange={this.onChange}>Type</Checkbox>
                          </Menu.Item>

                          <Menu.Item key="">
                                <Checkbox onChange={this.onChange}>Filter</Checkbox>
                          </Menu.Item>

                        </SubMenu>



                      </Menu>
                    </Sider>
                    <Content style={{ padding: '0 24px', minHeight: 280 }}>
                    <LineChart />
                    </Content>
                  </Layout>
              </Content>
           </div>
          </Layout>,

    </div>


    );
  }
}
export default ChartDashboard;
